import { Box, FormControl, FormLabel, Input, VStack } from "@chakra-ui/react";

function LoginPage() {
	return (
		<Box margin="20">
			<FormControl>
				<VStack spacing="5">
					<Box width="50%">
						<FormLabel>User ID</FormLabel>
						<Input />
					</Box>

					<Box width="50%">
						<FormLabel>Password</FormLabel>
						<Input />
					</Box>
				</VStack>
			</FormControl>
		</Box>
	);
}

export default LoginPage;
